import React from 'react';
import AddMovie from './components/AddMovie';
import './App.css';

import Header from './components/Header';

class App extends React.Component() {
  handleSubmit() {
    this.setState();
  }

  render() {
    return (
      <div className="App">
        <Header />
        <AddMovie handleSubmit={this.handleSubmit} />
      </div>
    );
  }
}


export default App;
